        image: "https://picsum.photos/500/400",
        website: "http//one,",
      },
      {
        id: 3,
        name: "hya",
        jop: "programmer",
        phone: "3445253",
        image: "https://picsum.photos/500/400",
        website: "http//one,",
      },
      {
        id: 2,
        name: "lora",
        jop: "programmer",
        phone: "3445253",
        image: "https://picsum.photos/500/400",
      },
    ]
  }
    ;
    this.state={
    members : this.state.info.map((member) => (
      <ProgrammersCard
        key={member.id}
        name={member.name}
        jop={member.jop}
        phone={member.phone}
        image={member.image}
        website={member.website}
      />
    ))}
  }
 
   
  render(){
  return (
    <div className="row justify-content-md-center ms-6">
      {members}
    </div>
  );}
}
export default ProgrammersGrid;
